import React from 'react';
import './Page.css';

const Page = ({ project, onClose }) => {
  return (
    <div className="page-container">
      <button className="close-button" onClick={onClose}>Close</button>

      <div className="page-content">
        <img className="page-image" src={project.imageURL} alt={card.title} />
        <h1 className="page-title">{project.title}</h1>
        <p className="page-description">
          This is the detailed view of the card. 
          Here you can place more information about the card, 
          descriptions, images, and additional actions.
        </p>
      </div>
    </div>
  );
};

export default Page;
